import React from 'react';

const FAQSection = () => {
  return (
    <div className="flex flex-col  justify-center bg-[#FFFF]">
      {/* Основной контейнер */}
      <div 
        className="max-w-6xl w-full flex flex-col md:flex-row items-center "
        style={{ width: '2500px', height: '450px' }} // Задаем ширину и высоту в пикселях
      >
        {/* Левая часть: Картинки */}
        <div className="w-full md:w-1/2 p-0 relative"> {/* Убрали padding и добавили relative */}
          {/* Фоновая картинка */}
          <img
            src="/images/img20.png" // Замените на путь к вашей фоновой картинке
            alt="Background"
            className="w-[400px]  ml-4 h-[450px] object-left" // Прижимаем к левому краю
            style={{ margin: '0' }} // Убираем отступы
          />
          {/* Основная картинка */}
          <img
            src="/images/img10.png" // Замените на путь к вашей основной картинке
            alt="Placeholder"
            className="absolute w-[250px] h-[280px] rounded-lg shadow-lg -mt-5 ml-[100px]"
            style={{ top: '25%', left: '25%' }} // Позиционирование основной картинки
          />
        </div>

        <div className="w-full md:w-1/2 px-6 py-3 flex flex-col items-center space-y-2 overflow-hidden">
  {/* Заголовок */}
  <div className="text-center">
    <h1 className="text-lg font-bold text-gray-800">FAQ</h1>
    <h2 className="text-xs text-gray-600">Got Questions?</h2>
  </div>

  {/* Кнопки */}
  <div className="space-y-1 w-full max-w-[calc(100%-50px)]"> {/* Уменьшаем ширину кнопок */}
    {/* Первая кнопка */}
    <button 
      className="w-full flex p-2 justify-between items-center gap-2 rounded bg-[#F8F7F0] hover:bg-[#E0DFD8] transition"
      onClick={() => alert('Button 1 clicked!')}
    >
      <h3 className="text-xs font-bold text-gray-800">Top vegan places</h3>
      <div className="flex items-center justify-center rounded bg-[#C5CE38] w-6 h-6">
        {/* Иконка */}
      </div>
    </button>

    {/* Вторая кнопка */}
    <button 
      className="w-full flex p-2 justify-between items-center gap-2 rounded bg-[#F8F7F0] hover:bg-[#E0DFD8] transition"
      onClick={() => alert('Button 2 clicked!')}
    >
      <h3 className="text-xs font-bold text-gray-800">Live natural</h3>
      <div className="flex items-center justify-center rounded bg-[#C5CE38] w-6 h-6">
        {/* Иконка */}
      </div>
    </button>
  </div>

  {/* Короткий текст */}
  <div className="text-gray-600 text-[10px] text-center mx-auto" style={{ paddingLeft: '35px', paddingRight: '15px' }}>
    <p>Stay healthy, stay informed.</p>
  </div>

  {/* Третья кнопка */}
  <button 
    className="w-full max-w-[calc(100%-50px)] flex p-2 justify-between items-center gap-2 rounded bg-[#F8F7F0] hover:bg-[#E0DFD8] transition"
    onClick={() => alert('Button 3 clicked!')}
  >
    <h3 className="text-xs font-bold text-gray-800">Best veggies</h3>
    <div className="flex items-center justify-center rounded bg-[#C5CE38] w-6 h-6">
      {/* Иконка */}
    </div>
  </button>
</div>
      </div>
    </div>
  );
};

export default FAQSection;
